import { BrowserRouter, Route, Switch  } from "react-router-dom";
import Home from "./pages";

class App extends Component {

  render () {
    return (
      <BrowserRouter>

      <Switch>
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/blog">
        <BlogPage />
      </Route>
      <Route path="/blog_sidebar">
        <SideBarBlogPage />
      </Route>
      <Route path="/post_sidebar">
        <PostWithSidebar />
      </Route>
      {/* <Route>
        <NoMatch />
      </Route> */}
    </Switch>
    </BrowserRouter>

   );
  }
}

export default App;
